import React from "react";

type SubItemProps = {
    text: string;
    onClick: () => void;
};

type ListItemProps = {
    text: string;
    subItems?: SubItemProps[];
    onClick: () => void;
};

const ListItem: React.FC<ListItemProps> = ({ text, subItems, onClick }) => {
    return (
        <li className="list-none">
            {/* Main item text */}
            <div
                onClick={onClick}
                className="cursor-pointer p-2 bg-[#f5f5f5] rounded hover:bg-gray-200 select-none"
            >
                {text}
            </div>

            {/* Sub-items */}
            {subItems && (
                <ul className="pl-4 mt-2 space-y-1">
                    {subItems.map((subItem, index) => (
                        <li
                            key={index}
                            onClick={subItem.onClick}
                            className="cursor-pointer p-2 bg-gray-100 rounded hover:bg-gray-200"
                        >
                            {subItem.text}
                        </li>
                    ))}
                </ul>
            )}
        </li>
    );
};


export default ListItem;
